def randmtx(r, l):
    res = Matrix(r, l)
    for i in range(r):
         for j in range(l):
             res.value[i][j] = ri(1,100)/10
    return res

def check_mul():
    for n in range(100):
        length1, length2, length3 = ri(3,5), ri(3,5), ri(3,5)
        mtx1 = randmtx(length1, length2)
        mtx2 = randmtx(length2, length3)
        print(f'[Matrix(value={mtx1.value}),Matrix(value={mtx2.value}),Matrix(value={mtx1.matrix_mul(mtx2).value})],', end='')
        

def det():
    for n in range(30):
        length = ri(2, 5)
        mtx1 = randmtx(length, length)
        print(f'[Matrix(value={mtx1.value}), {round(mtx1.determinant(), 6)}],', end="")

def multiply():
    for n in range(30):
        length = ri(2, 5)
        length2 = ri(2, 5)
        mtx1 = randmtx(length, length2)
        f = ri(1,10)
        print(f'[Matrix(value={mtx1.value}),{f}, Matrix(value={mtx1.multiply(f).value})],',end="")


